import * as actionTypes from "./actionTypes";


export const setSelectedModule = (data) =>{
    return{
        type: actionTypes.SET_SELECTED_MODULE,
        payload: data
    }

}

// Toast Action
export const resetToast = () =>{
    return{
        type: actionTypes.RESET_TOAST
    }
}
